contracts/wallet.sol.content:
// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.8.2 <0.9.0;

/**
 * @title Wallet Controller
 * @dev Manages all wallets on a chain
 * @custom:dev-run-script ./scripts/deploy_with_ethers.ts
 */
contract Wallet{

    error NotEnoughFunds(uint256 amountWanted, uint256 currentAmount);
    error UnAuthorizedWalletController(address walletControllerAddress, address receivedAddress);

    string ownerId;
    address walletControllerAddress;
    uint256 balance;

    constructor(address _controller, string memory _ownerId){
        walletControllerAddress = _controller;
        ownerId = _ownerId;
    }

    modifier fromWalletController(){
        if(msg.sender != walletControllerAddress){
            revert UnAuthorizedWalletController(walletControllerAddress, msg.sender);
        }
        _;
    }

    function checkBalance() public view returns (uint256) {
        return address(this).balance;
    }

    function swapTransfer(uint256 amount, uint64 destinationChainSelector, string calldata destinationOwnerId) public fromWalletController {

    }

    function deposit() external payable {
        balance += msg.value;
    }

    function withdraw(address withdrawAddress, uint64 chainSelector) external {

    }

}

